window.bookSummaryJSON = "<p>Choose between the rich boys.</p> <p>I’d rather face the harpies than make that choice.</p> <p>How can my four years at Burberry Prep really be coming to an end?</p> <p>No, Tristan, Zayd, Creed, Zack, and Windsor are everything to me right now. My strength, my passion, my heart, my empathy, my joy.</p> <p>Love is a cruel master, but I have no one to blame for this but myself.</p> <p>We fell in love with the charity case.</p> <p>Idols of the school. The kings of the campus. And we’re nothing without her.</p> <p>Marnye Elizabeth Reed - this girl has twisted our world upside down, but the Infinity Club is about to knock us all on our asses.</p> <p>Big money, political ties, family bonds, obligations - shit is going down at the academy. The rest of our lives, the rest of her life - it all comes down to this one final moment.</p> <p><i>In the Arms of the Elite</i> is a reverse harem/dark high school bully romance novel. This is book four of four in the series. Contains foul language and sexual scenes. All sex featured is consensual.</p>"; 
